import './Reviews.css';

import reviews from './revs.json'
import StarRating from '../Stars';

const Reviews = () => {


  let data = reviews.data
  console.log(data)


  return (
    <>
      <div className='reviews-intro'>
        <h3>Here is a list of our 65 google reviews! if you would like to check them out on the official google buisiness profile or to leave a review of your own, -</h3>
        <a href>
          <h3>Click Here-</h3>
        </a>
      </div>
      {
        data.map((review => (
          <div key={review.author_id} className='reviews-container'>
            <div className='name-star-container'>
              <p className='review-author'>{review.author_title}</p>
              <StarRating className='review-stars' rating={review.rating} />
            </div>
            <p>Date posted: {review.review_datetime_utc}</p>
            <p>{review.review_text}</p>
          </div>
        )))
      }
    </>
  );
};

export default Reviews;
